from string import ascii_lowercase,ascii_uppercase

class Solution:
    def greatestLetter(self, s: str) -> str:
        a = [[0,0] for i in range(26)]
        # print(a)
        for i,v in enumerate(s):
            if v.islower():
                ind = ascii_lowercase.index(v)
                a[ind][0] = 1
            else:
                ind = ascii_uppercase.index(v)
                a[ind][1] = 1
        print(a)
        for i in range(25,-1,-1):
            if a[i][0] == 1 and a[i][1] == 1:
                return ascii_uppercase[i]
        return "" 

if __name__ == "__main__":
    func = Solution().greatestLetter
    s = ""
    print(func(s))